import 'package:flutter/material.dart';
import 'package:game1/thirdpage.dart';
import 'package:maze/maze.dart';
import 'main.dart';

class Secondpage extends StatefulWidget {

  @override
  _SecondpageState createState() => _SecondpageState();
}

class _SecondpageState extends State<Secondpage> {


  @override
  Widget build(BuildContext context) {
    dynamic args = ModalRoute.of(context)!.settings.arguments;
    return Scaffold(
      appBar: AppBar(title: Text("Game"),centerTitle: true,backgroundColor: Colors.black,),
      backgroundColor: Colors.white,
      body: SafeArea(
        child:Maze(player: MazeItem("data:image/jpeg;base64,", ImageType.network),
          columns:args.c,
          rows: args.r,
          wallThickness: 3.0,
          wallColor: args.mycolor,
          finish: MazeItem("data:image/png;base64,",ImageType.network),
          onFinish: ()
          {
            setState(() {
              Navigator.of(context).pushNamed("Thirdpage");
            });
          },
        ),
      ),
    );
  }
}


class rowcolum
{
  late int r;
  late int c;
  late Color mycolor;
  rowcolum({required this.r,required this.c,required this.mycolor});

}